(169, 1, 'Spring Hunger Games', 'Fort Flagler', 'Campout with homemade shelters at Fort Flagler SP.  Bring your scout shirt, a lunch for saturday, your 10 essentials, sleeping gear, and boxes and tarps if you have them.  It will be patrol food.  All electronics are to be turned off for the weekend and only used to call parents on the way home.', '2019-03-23 08:00:00', '2019-03-24 13:00:00', '10.00', '0.00', 0, 137, 0),
(170, 1, 'Annual Basic Skills', 'Dosiwallips SP', 'Annual basic skills where old scout teach young scouts how to camp and to function in the troop.  We will be meeting at CHAPEL HILL back parking area.', '2019-04-26 16:30:00', '2019-04-28 13:30:00', '10.00', '0.00', 0, 0, 0),
(171, 1, 'Spring Bike outing', 'Rainbow Falls State Park', 'Spring bike camping outing.  Ride the Willapa bike trail 16 miles into camp where our gear will be waiting for us.  We will explore the history of the trail and surrounding area.  Sunday morning we will ride out from the campground.  It will be Troopl food and you need to have a good functioning bik', '2019-05-18 07:30:00', '2019-05-19 13:00:00', '20.00', '0.00', 0, 0, 0),
(172, 1, 'Bike Orienteering', 'Banner Forest', 'Bike Orienteering and BBQ day outing at Banner forest.  Meet at QM with your bike helmet, tire changing equipment, compass reading to race.  BBQ will be served after.', '2019-06-15 09:00:00', '2019-06-15 13:00:00', '10.00', '0.00', 23, 209, 1),
(173, 1, 'Bike Campout', 'Lake Easton SP', 'Biking on the Palouse to Cascades trail.  Will be going through the Snoqualmie Tunnel so you will need a light.  Bring a sack lunch for Saturday, spare tube and bike essentials.  Downhill both ways.', '2019-07-13 08:00:00', '2019-07-14 15:00:00', '20.00', '0.00', 23, 124, 0),
(174, 1, 'Flight Museum Trip', 'Boeing Flight Museum', 'Trip to flight museum to work on Space Exploration MB. Please bring a packed sack lunch. Meet at the upper parking lot at Chapel Hill near the fireside room. ', '2019-07-30 11:00:00', '2019-07-30 17:30:00', '10.00', '0.00', 306, 224, 0),
(175, 1, 'Family Bike Overnight', 'Rainbow Falls State Park ', 'Biking Campout with the Whole family welcome!', '2019-09-14 08:00:00', '2019-09-15 15:00:00', '10.00', '0.00', 23, 185, 1),
(176, 1, 'Annual Leadership Outing', 'All Saints Camp Raft Island', 'Annual Leadership Outing. Meet at camp at 6:45pm Friday and pick up from camp at 10:00 am Sunday ', '2019-11-08 17:00:00', '2019-11-10 15:00:00', '20.00', '0.00', 20, 229, 1),
(177, 2, 'Hiroki\'s Eagle Project', 'Narrows Park', 'Hiroki\'s Eagle Project: Removing invasive species of plants. Bring gloves and yard tools for blackberry removal.  Also split rail fence building', '2018-11-07 15:30:00', '2018-11-07 17:30:00', '0.00', '0.00', 96, 97, 1),
(178, 3, 'Hiroki\'s Eagle Project ', 'Narrows Park', 'Hiroki\'s Eagle Project: Removing invasive species of plants. Bring gloves and yard tools for blackberry removal. Also split rail fence building', '2018-11-10 09:00:00', '2018-11-10 12:30:00', '0.00', '0.00', 0, 0, 1),
(179, 2, 'Hiroki\'s Eagle Project shift II ', 'Narrows Park', 'Hiroki\'s Eagle Project: Removing invasive species of plants. Bring gloves and yard tools for blackberry removal. Also split rail fence building', '2018-11-10 12:30:00', '2018-11-10 15:30:00', '0.00', '0.00', 96, 97, 1),
(180, 1, 'Zombie invasion Camporee', 'Camp Thunderbbird', 'http://zombieinvasioncamporee.com\n', '2019-10-18 16:30:00', '2019-10-20 11:30:00', '25.00', '25.00', 0, 0, 0),
(181, 1, 'Signs Signals and Codes Completion Hike', 'McCormick Forest Park', 'Complete the Signs Signals and Codes merit badge by participating in this hike. Scouts who went to the Fall Camporee will want to sign up.  We will meet at the fire headquarters (not the station with the engine) where the dog walk parking is located.', '2019-01-05 09:00:00', '2019-01-05 10:30:00', '0.00', '0.00', 23, 205, 1),
(182, 1, 'Northern TIer Canoe - High Adventure Out', 'Ely Minnesota', 'Canoeing through the 1000 lakes of Minnesota.  A true high adventure outing!', '2020-08-04 07:30:00', '2020-08-12 18:30:00', '100.00', '100.00', 38, 45, 0),
(183, 1, 'Summer Camp First Payment', 'Camp Easton', 'This is the first payment to hold your spot for summer camp.  This first payment is due by March 1st 2019.  Any questions contact Glenn Rogers rogersclan@prodigy.net or 253-273-1026.', '2019-06-22 12:00:00', '2019-06-22 12:00:00', '100.00', '0.00', 0, 0, 1),
(184, 1, 'Summer Camp Second Payment', 'Camp Easton', 'This is the second summer camp payment.  Final payment will be in May when total amounts are finalized.', '2019-06-22 12:00:00', '2019-06-22 12:00:00', '100.00', '0.00', 0, 0, 1),
(185, 1, 'Practice Hike', 'Mt Si', 'Practice hike for Philmont group though all are welcome, participants should be ready for a vigorous climb (4000 feet elevation) along a trail, trekking poles and microspikes are recommended (I have extra spikes and can help with the poles if you need it) - Dr H', '2019-02-03 07:00:00', '2019-02-03 14:00:00', '0.00', '0.00', 38, 45, 1),
(186, 1, 'Practice Hike (Philmont)', 'Duckabush to 5 mile cam ', 'This is another practice philmont hike, all scouts are welcome to join.  Some mild elevation, 8.8 mile round trip.  Bring rain gear as weather is unpredictable.  ', '2019-03-16 07:00:00', '2019-03-16 14:00:00', '0.00', '0.00', 38, 68, 1),
(187, 1, 'Philmont Hike III', 'Mason Lake/ Mount Defiance', 'Practice Hike in the Cascades, should be a challenge with about 3800 feet elevation gain in 5 miles (and then we go back down) should be similar to a Mt Si.  All scouts are welcome to attend, but must be prepared to finish the hike.', '2019-04-13 07:00:00', '2019-04-13 14:00:00', '0.00', '0.00', 38, 44, 1),
(188, 2, 'Wood Lot Clean Up', 'Mr. Smarr\'s Wood Lot address below', 'We will be cleaning the wood lot of bark and debris so that grass can grow back in that area.  Come prepared with gloves, rakes, and water. 13407 6th Ave NW Gig Harbor', '2019-02-02 08:30:00', '2019-02-02 11:30:00', '0.00', '0.00', 20, 100, 0);
