(197, 2, 'Artondale Cemetery Clean Up', 'Artondale Cemetery 5512 Hunt Street NW, Gig Harbor', 'Annual Spring Cleanup and Hot Dog Bar-B-Que. Help with the annual clean up of the Artondale Cemetery. Come dressed to work. Hot dog lunch provided.', '2019-05-04 08:00:00', '2019-05-04 14:00:00', '0.00', '0.00', 20, 224, 1),
