(201, 2, 'Flag Ceremony for Vietnam Vets', 'Gig Harbor Civic Center', 'Come be part of the flag ceremony for an award ceremony for vietnam Veterans.  We will also be talking with an elected representative to complete req 9a of first class.', '2019-03-29 17:00:00', '2019-03-29 18:00:00', '0.00', '0.00', 23, 124, 1),
