(206, 3, 'Wood Sale Delivery 2', 'Mr. Smarr\'s Wood Lot address below', '13407 6th Ave NW Gig Harbor WA\nThe Second delivery day... Lets clean out the wood lot. The event will be over when the deliveries are complete.', '2019-10-26 08:00:00', '2019-10-26 12:00:00', '0.00', '0.00', 38, 97, 1),
(207, 2, 'Race for a Soldier event staffing', 'Peacock Hill and Firdrona intersection', 'This event conflicts with the family outing. Do not sign up if you are going on the family outing.  This event you will be helping guide runners of the Race for a soldier 10k.  ', '2019-09-15 07:30:00', '2019-09-15 11:00:00', '0.00', '0.00', 38, 95, 1),
(208, 2, 'Fort Nisqually Candel Light Tour Friday', 'Ft Nisqually, Point Defiance Tacoma', 'Help keep the tour groups together during their candle light walking tour of the fort.  Meet at the fort. Tell the road guards that you are volunteering and they should let you through. \nThis service project requires a training that will be announced', '2019-10-04 17:45:00', '2019-10-04 22:00:00', '0.00', '0.00', 306, 13, 1),
(209, 2, 'Fort Nisqually Candlelight Tour Saturday', 'Fort Nisqually Point Defiance Tacoma', 'Help keep the tour groups together during their candle light walking tour of the fort.  Meet at the fort tell the road gate guards you are a volunteer. \nThis service project requires a training that will be announced', '2019-10-05 17:15:00', '2019-10-05 22:00:00', '0.00', '0.00', 306, 13, 1),
(210, 2, 'Trunk or treat at Voyager', 'Voyager Elementary ', 'Help run the games and fun activities at Voyager Elementaryâ€™s trunk or treat Halloween celebration! Please wear your Class A uniform and MEET at Voyager at 2:45 for training and stay to help clean up at 5:15', '2019-10-27 14:45:00', '2019-10-27 15:15:00', '0.00', '0.00', 309, 310, 1),
(211, 1, 'Seabase', 'Florida', 'Dates are not official, just want to get a list started of interested individuals, once the program is decided upon a deposit fee cost will be added to the event', '2021-07-01 12:00:00', '2020-12-10 12:00:00', '100.00', '100.00', 319, 0, 0),
(212, 1, 'Igloo Practice', 'Snoqualmie Pass', 'This is the day outing where the troop practices building Igloos for the high adventure outing overnight at Mt. Rainier.  This is a great place/time to check gear and use best practices for the overnight.  bring a sack lunch', '2020-01-25 07:30:00', '2020-01-25 16:30:00', '5.00', '0.00', 98, 209, 1),
(213, 4, 'Holiday Bowling Party w/ Bros', 'Narrows Bowl', 'Come and have some bowling fun and Bro time with your scouting friends at Narrows bowl.  We have the lanes from 6-8. The first pitcher of root beer is on the troop! Snack and video games is out of your own pocket.  Carpool and find your own ride, meet at the bowling alley.', '2019-12-20 18:00:00', '2019-12-08 12:00:00', '0.00', '0.00', 20, 45, 1),
(214, 1, 'Submarine Base Behind the Scenes Tour W/', 'Keyport Submarine Museum/', 'Behind the scenes tour of the Submarine base at Keyport.  There are very specific Identification requirements that must be met prior to the outing. Passport, enhanced drivers license or birth certificate There are only 34 allotted spots, the signup is limited. ', '2020-02-20 08:30:00', '2020-02-20 15:00:00', '10.00', '0.00', 306, 100, 0),
(215, 1, 'Igloo Overnight ', 'Mt. Rainier, Dead Horse Creek ', 'This is the big one. Igloo overnight at Dead Horse Creek campground at Paradise Mt. Rainier.  Personal food. Participation Must be okayed by the AIC if you don\'t go to the practice.  Gear Check required.', '2020-02-08 07:00:00', '2020-02-09 13:00:00', '15.00', '0.00', 38, 312, 1),
(216, 1, 'Basic Skills', 'Dosiwallips State Park', 'Basic Skills, where lots of the everyday scouting skills are taught and put into practice.  ', '2020-04-24 16:30:00', '2020-04-26 13:00:00', '20.00', '0.00', 306, 229, 1),
(217, 4, 'Troop Holiday Bowling', 'Narrows Plaza Bowl', 'Come bowl with your friends and celebrate the start of the Christmas break. The troop will cover bowling and shoe rental and the first round of root beer. Bring money for snack or video games if that is your interest. ', '2019-12-20 18:00:00', '2019-12-20 20:00:00', '0.00', '0.00', 20, 45, 1),
(218, 1, 'Alaska aviation day', 'Sea tac', 'Canceled...... Alaska dosent want you getting sick.  ', '2020-05-02 07:30:00', '2020-05-02 16:00:00', '0.00', '0.00', 0, 0, 0),
(219, 1, 'canoe outing', 'Mossyrock State Park', 'Fun time at Mossyrock, camping by the lake canoeing over to the Dam, all scouts will have a good time but any summer time canoers (for long term or Northern Tier) should make a point of going ', '2020-03-21 08:00:00', '2020-03-22 12:00:00', '10.00', '0.00', 38, 185, 0),
(220, 1, 'Rock Climbing', 'To be determined', 'Either a day outing or an over night but we\'ll be climbing, all scouts welcome', '2020-05-17 12:00:00', '2020-05-17 12:00:00', '5.00', '0.00', 38, 0, 1),
(221, 1, 'Blake Island Canoe', 'Blake Island', 'One of the best outings we do.  Canoe from Port Orchard to Blake Island (land of the Racoons) and spend the night.  All Conoers should attend but all scouts are welcome', '2020-06-28 08:00:00', '2020-06-29 12:00:00', '10.00', '0.00', 38, 0, 1),
(222, 1, '0', '0', 'Our 50 miler this year is on the canoes.  Many of the details to come but these dates seem good for the adults.  this outing is a challenge but alot of fun and chock full of adventure.', '2020-07-01 12:00:00', '2020-07-01 12:00:00', '50.00', '50.00', 306, 297, 1),
(223, 1, 'Seabase - Sailing', 'Florida', 'STEM ECO Sailing adventure, 7 days and 6 nights living aboard one of two sailboats (crew of 12 has two boats), trip will include kayaking, fishing, snorkeling, learning about the various habitats for wildlife in the Keys - what an awesome sounding trip', '2021-08-11 12:00:00', '2021-02-25 12:00:00', '120.00', '120.00', 98, 0, 0),
(224, 1, 'Seabase - fishing', 'Florida', 'Fishing trip of a lifetime!!  Fish off shore in the Keys, some paddling and snorkeling also included.  Stay in the air conditioned dorms of Seabase between daily excursions to the keys.', '2021-08-10 12:00:00', '2020-12-10 12:00:00', '178.00', '178.00', 210, 209, 1),
(225, 1, 'Seabase - Scuba', 'Florida', 'Explore coral reefs, shipwrecks, and the beautiful waters of the Florida Keys, with up to 11 dives including a night dive.  Stay in the air conditioned dorms at Seabase between daily diving adventures.', '2021-08-08 12:00:00', '2020-12-10 12:00:00', '175.00', '175.00', 319, 45, 1),
(226, 1, 'Camp Meriwether, Cancelled', 'Camp Meriwether, Oregon', 'Summer Camp, Please work on getting your BSA Health forms filled out as they are required ', '2020-08-08 08:30:00', '2020-08-15 14:30:00', '293.00', '0.00', 55, 0, 0),
(227, 1, 'Tubal Cain Day Hike', 'Olympic National Forest', 'This will be our first outing within the boundries of the state mandates.  Small groups will be formed,  with assigned adults.  These small groups will travel and hike together and masks will be worn while in cars.  Tubal Cain is a 7-8 mile round trip hike that is doable for any scout. Bring your pa', '2020-07-18 06:30:00', '2020-07-18 17:00:00', '0.00', '0.00', 98, 68, 1),
(228, 1, 'Summer Mini Camp', 'Farm/Kopachuck/Crystal Mountain', 'Troop 212 is proposing a mimi-camp to work on basic skills.  This is dependent on the stage and health restrictions.  This is tentative and a formal proposal is being researched and will be proposed.  If it is possible, it will happen on these dates so please keep these dates in made while making pl', '2020-08-10 08:00:00', '2020-08-13 16:00:00', '40.00', '0.00', 98, 237, 1),
(229, 1, 'Snoquamie Pass Backpacking Hike', 'Snoqualmie pass', 'The troop is also planning a backpacking trip to Snoqualmie Pass on September 19-20  It is approximately a mile hike up to the top of the pass and there is a nice little area to set up tents.  Same rules will apply as Crystal mountainâ€¦Siblings sleep together, single man tents are authorized, or bo', '2020-09-19 12:00:00', '2020-09-20 12:00:00', '10.00', '0.00', 98, 312, 1),
(230, 4, 'Car Wash (AM SHIFT / 0900-1200)', 'Shell Station (6615 Wollochet Drive)', 'Troop 212 Car.wash.  The location is at the Shell station off Wollochet.  We\'re looking for boys to sign up for the AM or PM shift (or both if they want to hang out).  The AM shift will run from 0900-1200 and the PM shift will run from 1200-1500. ', '2020-09-26 09:00:00', '2020-09-26 12:00:00', '0.00', '0.00', 98, 155, 1),
(231, 4, 'Car Wash (PM Shift/1200-1500)', 'Shell station (6615 Wollochet Drive)', 'Troop 212 Car.wash.  The location is at the Shell station off Wollochet.  We\'re looking for boys to sign up for the AM or PM shift (or both if they want to hang out).  The AM shift will run from 0900-1200 and the PM shift will run from 1200-1500.  ', '2020-09-12 12:00:00', '2020-09-12 12:00:00', '0.00', '0.00', 98, 155, 1),
(232, 4, 'Car Wash (PM Shift (12:00-3:00)', 'Shell Station (6615 Wollochet Drive)', 'Troop 212 Car.wash. The location is at the Shell station off Wollochet. We\'re looking for boys to sign up for the AM or PM shift (or both if they want to hang out). The AM shift will run from 0900-1200 and the PM shift will run from 1200-1500.', '2020-09-26 12:00:00', '2020-09-26 15:00:00', '0.00', '0.00', 98, 155, 1),
(233, 1, 'Engineering Outing', 'Millersylvania State Park', 'Engineering outing scheduled for October 17-18.  We will meet at the Quartermaster Shack at 0900 for a 0930 departure.  Troop food will be provided and we are planning on a 1100 return.  ', '2020-10-17 08:00:00', '2020-10-18 11:00:00', '20.00', '0.00', 98, 155, 0),
(234, 1, 'Leadership Outing', 'Hunter Ashlock house', 'Annual Leadership Outing. Meet at Mr. Ashlocks house on Saturday 21 Nov from 10:00am to 4:00pm.  Lunch will be NOT be provided.  Please bring your own food and drinks.  \nAddress:\n4210 10th st NW\nGig Harbor, WA 97335\n*** Please park on the street if driving ***\n- Please bring a camp chair to sit in. ', '2020-11-21 09:00:00', '2020-11-21 13:00:00', '0.00', '0.00', 98, 224, 0),
(235, 4, 'Adult leader Re-Charter', 'Annual recharter fee', 'Not mandatory, but if you are an adult leader and can spare to cover the cost of membership we are requesting you do.  We understand it\'s COVID and it has impacted families financially.  No pressure and no obligation because it this is also during the holiday season.  ', '2020-11-23 12:00:00', '2021-01-24 18:30:00', '0.00', '57.00', 98, 0, 1),
(236, 1, 'Igloo build Practice', 'Snoqualmie Pass', 'Annual igloo building practice for overnight.  This will be a day outing where we learn to build igloos.  weather dependent and subject to state mandated restrictions.', '2021-01-23 06:45:00', '2021-01-23 17:00:00', '0.00', '0.00', 0, 209, 1),
(237, 1, 'Spring New Scout Outing', 'DOSEWALLIPS', 'Spring outing.  Details forthcoming.  Subject to state mandated restrictions.', '2021-03-20 08:00:00', '2021-03-21 11:30:00', '10.00', '0.00', 0, 312, 1),
(238, 1, 'Basic skills', 'Gig Harbor Farm', 'Annual basic skills where older scouts teach new scouts the basics of camping with the troop.  Subject to state mandated restrictions.', '2021-04-23 18:00:00', '2021-04-25 10:00:00', '10.00', '0.00', 98, 315, 1),
(239, 1, 'Summer Camp', 'Camp Meriwether', 'Summer Camp at Meriwether.   more information regarding cost will be forthcoming determined by the troops fundraising but the base price is $418.00. Camp subject to state mandated restrictions. ', '2021-06-26 12:00:00', '2021-07-03 16:00:00', '100.00', '0.00', 98, 45, 0),
(240, 1, 'Winter Overnight Outing', 'Buck Creek', 'Winter Campout.  This year we will not be sleeping in igloos. We will use our tents and camp at Buck Creek near Greenwater WA.  More details to follow regarding compliance with Covid safety protocols.  Outing subject to state mandated restrictions.', '2021-02-20 09:00:00', '2021-02-21 12:00:00', '10.00', '0.00', 98, 315, 0),
(241, 4, 'SEABASE SAILING', 'SAILING CREW', 'This is the third and final payment for the Sailing crew heading to SEABASE.  Please keep in mind, the third and final payment only covers the program.  There will be additional fees for airline tickets, transportation, hotel costs, and any outings in Florida we would like to do before or after the ', '2021-08-09 07:00:00', '2021-04-02 16:00:00', '535.00', '535.00', 98, 68, 0),
(242, 4, 'Seabase FISHING', 'SEABASE', 'SEABASE FISHING TEAM.  Third payment', '2021-05-01 12:00:00', '2021-05-02 12:00:00', '662.50', '662.50', 210, 0, 0),
