(330, 1, 'Igloo Overnight', 'Dead Horse Gulch (Mt. Rainier NP)', 'This is the overnight Igloo outing at Dead Horse Gulch, located in Mount Rainier National Park.  ', '2024-02-10 06:00:00', '2024-02-11 11:00:00', '10.00', '0.00', 98, 373, 1),
(331, 1, 'Jim Creek Overnight', 'Jim Creek Naval Communication base', 'We will be camping in heated cabins at Jim Creek Naval base.  We will be sleeping on bunkbeds with mattresses.  ', '2024-03-08 15:30:00', '2024-03-10 12:00:00', '30.00', '0.00', 98, 344, 0),
(332, 1, 'Swim test for canoe outings ', 'Stadium High School', 'This is the mandatory swim test for all Scouts who plan to go on any canoe outings.  ', '2024-03-23 15:00:00', '2024-03-23 17:00:00', '0.00', '0.00', 306, 307, 1),
(333, 1, 'Basic Skills ', 'Green Mountain', 'We will be camping at Green Mountain for Basic Skills.  We will be eating patrol food.  ', '2024-04-26 15:30:00', '2024-04-28 12:00:00', '20.00', '15.00', 98, 392, 0),
(334, 1, 'Canoe Practice (Day Outing)', 'Cutts Island', 'This is a day outing to practice for the long term outing.  All canoe practices are required for the long term outings.  ', '2024-04-06 08:30:00', '2024-04-06 15:30:00', '5.00', '0.00', 23, 354, 0),
(335, 1, 'Canoe Practice Overnight', 'Ocean Shores', 'This is an overnight canoe practice. The location is Ocean City State Park.  We will be paddling in the freshwater canals and camping at the state park.', '2024-05-18 07:00:00', '2024-05-19 14:00:00', '15.00', '10.00', 23, 344, 0),
(336, 1, 'Camp Roosevelt summer camp_#1 payment', 'Roosevelt Lake (Lambs Draw)', 'Annual Summer camp.  We will be heading to Camp Roosevelt.  Summer camp will cost $325 and will include a camp Roosevelt shirt.  This is the initial payment', '2024-06-01 08:00:00', '2024-06-15 16:00:00', '200.00', '0.00', 23, 392, 1),
(337, 1, 'Canoe Practice (Day Outing) ', 'Lake Cushman', 'This is a canoe practice outing to get us ready for the long term Canoe Outing.   ', '2024-06-08 06:30:00', '2024-06-08 16:00:00', '10.00', '0.00', 23, 335, 0),
(338, 1, 'Overnight Canoe Practice', 'Blake Island', 'This is an overnight canoe practice.  This outing is required for all Scouts attending the long term paddle trip in August.  ', '2024-07-20 07:00:00', '2024-07-21 12:00:00', '15.00', '0.00', 462, 335, 0),
(339, 1, 'Long Term Canoe Outing. Initial payment ', 'Lake Roosevelt', 'Long Term Canoe outing.  Additional details to come. ', '2024-08-14 08:00:00', '2024-08-20 16:00:00', '100.00', '0.00', 23, 335, 0),
(340, 1, 'Fire mountain overnight ', 'Fire mountain scout camp', 'We will be camping at Fire Mountain from Sep 13-15. We will have an opportunity to earn a few merit badges and utilize the zip line.  ', '2024-09-13 17:00:00', '2024-09-15 15:00:00', '25.00', '10.00', 98, 406, 0),
(341, 1, 'Elks Lodge Game Night', 'Elks Lodge', 'Game night at the Elks Lodge.  ', '2024-10-25 20:00:00', '2024-10-26 08:00:00', '10.00', '0.00', 98, 447, 1),
(342, 1, 'Leadership Outing', 'Raft Island', 'Annual Leadership outing,  Location is Raft Island', '2024-11-15 18:00:00', '2024-11-17 10:00:00', '45.00', '20.00', 98, 392, 1),
(343, 4, 'Pack 202 Blue and Gold', 'Chapel Hill ', 'Pack 202 Blue and Gold.  Chapel Hill from 6:00-8:00pm', '2024-02-08 18:00:00', '2024-02-08 20:00:00', '0.00', '0.00', 98, 357, 1),
(344, 1, 'Alaska Airlines Aviation Day', 'Alaska Airlines Hangar', 'Our annual aviation day is here. Scouts will have the opportunity to earn the Engineering merit badge and the aviation day merit badge. Space is limited.', '2024-06-01 07:30:00', '2024-06-01 17:00:00', '5.00', '0.00', 98, 336, 0),
(345, 1, 'Paddlers Cup Overnight outing', 'Skansie Park', 'Logistics for Paddlers Cup security overnight camping:\nDate:  Saturday 4/20 \nTime: 4/20 4:00 p.m. to 4/21 7:30 a.m.\nParking:  there should be street parking right around the Skansie pavilion.  We have some spots blocked off for vendors you might access if the vendors have packed up for the day.', '2024-04-20 16:00:00', '2024-04-21 07:30:00', '5.00', '0.00', 98, 307, 1),
(346, 2, 'Artondale Cemetery Annual Cleanup', 'Artondale Cemetery', 'Help clean up the Artondale Cemetery\n5512 Hunt Street NW, Gig Harbor, WA\nHot Dog lunch will be provided at 11am, after the Annual Membership Meeting.\nBring: gloves, rakes, wheelbarrow or tarp to haul debris, pruning shears, etc.', '2024-05-04 08:00:00', '2024-05-04 15:00:00', '0.00', '0.00', 98, 0, 1),
(347, 4, 'JY fake event test', 'TBD', 'Test for new paypal account', '2020-03-09 12:00:00', '2020-03-11 12:00:00', '1.00', '0.00', 404, 405, 0),
(348, 4, 'JY fake test 2', 'TBD', 'fake test for paypal on the troop site, 2', '2020-03-10 12:00:00', '2020-03-10 12:00:00', '1.00', '0.00', 404, 405, 0),
(349, 2, 'David Rogers Eagle Project', 'Green Mountain', 'David Rogers will be having his Eagle Scout Project on Saturday the 13th of April. We will meet at the Quartermaster Shack at 7:30 and leaving by 8am. LUNCH WILL BE PROVIDED along with snacks. We are going to be barbecuing so be ready for burgers and hotdogs. All hands available are greatly apprecia', '2024-04-13 08:00:00', '2024-04-13 16:00:00', '0.00', '0.00', 23, 297, 1),
(350, 1, 'Summer Camp Final Payment', 'Camp Roosevelt (Lambs Draw)', 'Final Summer Camp Payment. This will cover all food and a shirt.  ', '2024-06-23 12:00:00', '2024-06-29 14:00:00', '125.00', '0.00', 98, 307, 1),
(351, 2, 'Gig Harbor Car Show', 'Gig Harbor (Location TBD)', 'Scouts will work at the Gig Harbor Car show.  Details to follow', '2024-08-03 08:00:00', '2024-08-03 16:00:00', '0.00', '0.00', 98, 412, 0),
(352, 1, 'Long Term Paddle Practice', 'TBD', 'This is a practice outing for scouts going on the long term paddle outing.  this will either be a skillz/teambuilding at Long Lake or a 10 mile paddle out of Gig Harbor.', '2024-07-22 16:00:00', '2024-07-22 20:00:00', '0.00', '0.00', 23, 335, 1),
(353, 1, 'Long Term Paddle Practice', 'Long Lake', 'This is a practice outing for scouts going on the long term paddle outing.  this will either be a skillz/teambuilding at Long Lake or a 10 mile paddle out of Gig Harbor.', '2024-08-07 16:00:00', '2024-08-07 20:00:00', '0.00', '0.00', 23, 335, 1),
(354, 2, 'Race for a Soldier flyer distribution', 'The Ridge and Harbor Hill', 'Do you need volunteer hours?  If so, we will have the “Race for a Soldier” flyer distribution. We will be distributing Race for a Soldier flyer in the “Harbor Hill” and “The Ridge” neighborhoods. We will be passing out the flyers on Thursday, August 29 from 6:00 pm until finish.  ', '2024-08-29 18:00:00', '2024-08-29 21:00:00', '0.00', '0.00', 98, 0, 1),
(355, 2, 'Fort Nisqually Candle light tour', 'Fort Nisqually', 'Fort Nisqually candle light tour volunteer opportunity', '2024-10-04 17:00:00', '2024-10-04 22:00:00', '0.00', '0.00', 306, 430, 1),
(356, 2, 'Fort Nisqually candle light tour', 'Fort Nisqually', 'Fort Nisqually candle light tour volunteer opportunity', '2024-10-05 17:00:00', '2024-10-05 22:00:00', '0.00', '0.00', 306, 430, 1),
(357, 1, 'Vampire Night Orienteering Course', 'Robinswood Park (Bellevue)', 'Vampire night Orienteering course. Dress for weather and night time temps.  Bring compass and flashlight. Details can be found here https://cascadeoc.org/event/vampire/  We will meet at 3PM at McCormick Trails meadow to work on the Orienteering MB', '2024-10-19 15:00:00', '2024-10-19 21:00:00', '15.00', '0.00', 23, 297, 0),
(358, 1, 'Camp Meriwether initial payment', 'Camp Meriwether', 'Summer Camp at Camp Meriwether.  Summer camp is $603 for Scouts and $302 for Adults.  We will need to conduct some fundraising to drive this cost down.  This is the initial $100 deposit.  The remaining balance will be due at a later time.  The dates for Camp Meriwether at July 6 – July 12 2025', '2025-02-03 08:00:00', '2025-02-09 21:00:00', '100.00', '50.00', 0, 0, 1),
(359, 1, 'Long Term Bike Ride initial payment', 'San Juan Islands', 'Long term bike ride in the San Juans.  This is the initial payment.  The estimated fees will be $300 per scout for a week in the San Juans.  The dates for the long-term bike ride in the San Juan islands are August 13-19 2025.', '2025-03-02 08:00:00', '2025-03-09 22:00:00', '100.00', '25.00', 98, 0, 1),
(360, 1, 'Night Hike Camp Thunderbird', 'Camp Thunderbird', '10 mile hike with a challenge activity every mile throughout the night and camp at Thunderbird.  Bring your 10 essentials and plan on November weather.  Sign ups will close on October 31.  You must be first class and above except with permission from the scoutmaster to sign up as this is a strenuous', '2024-11-23 17:00:00', '2024-11-24 12:00:00', '40.00', '0.00', 23, 447, 1),
(361, 1, 'Fort Steilacoom Oreinteering', 'Fort Steilacoom Park', 'Last event on our Orienteering merit badge journey.  Details can be found at the link below.  Do not register on the cascade orienteering site.\nhttps://cascadeoc.org/event/2024-25-winter-league-3-pierce-college-fort-steilacoom-park/ sign up closes 11/20\n', '2024-12-07 08:00:00', '2024-12-07 14:00:00', '10.00', '0.00', 23, 0, 1),
(362, 2, 'Elks Lodge Dinner', 'Elks Lodge', 'We are cooking for the Elks Lodge nd families are invited.  Dinner is $15.00 per Adult and $15.00 per scout) and the money will be collected at the door.  Adults are requested to sign up and use the seat belts as a head count for how many family member will be attending, including scouts.  The Scout', '2024-10-25 17:00:00', '2024-10-25 20:00:00', '0.00', '0.00', 98, 344, 1),
(363, 1, 'Philmont 2026 initial deposit', 'Philmont Scout Camp (New Mexico)', 'Initial deposit for Philmont 2026', '2024-10-21 08:30:00', '2024-11-30 16:00:00', '150.00', '150.00', 98, 0, 1);
